export const BASE_URL = 'https://restcountries.com/'
export const VERSION = 'v3.1/'

export const ERROR_MESSAGES = {
    NETWORK_ERROR: "Unable to connect to the network. Please try again later.",
    SERVER_ERROR: "An error occurred while retrieving data from the server. Please try again later.",
    UNKNOWN_ERROR: "An unknown error occurred. Please try again later.",
  };
